import React, { useContext } from 'react';
import { ThemeContext } from '../context/ThemeContext';
import { Link } from 'react-router-dom';

function Header() {
  const { darkMode, setDarkMode } = useContext(ThemeContext);

  return (
    <header className="flex flex-col sm:flex-row sm:justify-between items-center p-4 bg-blue-600 text-white shadow">
      <h1 className="text-2xl font-bold mb-2 sm:mb-0">üèçÔ∏è Bike Rentals</h1>

      <div className="flex flex-col sm:flex-row items-center gap-4">
        <nav className="flex gap-4">
          <Link to="/" className="hover:underline">Home</Link>
          <Link to="/book" className="hover:underline">Book</Link>
          <Link to="/rent" className="hover:underline">Rent Out</Link>
          <Link to="/profile" className="hover:underline">Profile</Link>
        </nav>

        <button
          onClick={() => setDarkMode(!darkMode)}
          className="px-3 py-1 border rounded bg-white text-blue-600 hover:bg-gray-100 hover:text-blue-700 transition"
        >
          {darkMode ? '‚òÄÔ∏è Light' : 'üåô Dark'}
        </button>
      </div>
    </header>
  );
}

export default Header;
